import React, {
  Component
} from 'react';
import search from '../../../_assets/images/menu/search.svg';
import VerticalScrollbars from '../../../_assets/Scrollbars/VerticalScrollbars';
import {
  Collapse
} from 'reactstrap';
export default class Systems extends Component {
  constructor(props) {
    super(props);
    this.toggle = this.toggle.bind(this);
    this.toggle1 = this.toggle1.bind(this);
    this.toggle2 = this.toggle2.bind(this);
    this.toggle3 = this.toggle3.bind(this);
    this.toggle4 = this.toggle4.bind(this);
    this.toggle5 = this.toggle5.bind(this);

    this.state = {
      collapse: false,
      collapse1: false,
      collapse2: false,
      collapse3: false,
      collapse4: false,
      collapse5: false
    };
  }

  toggle() {
    this.setState(state => ({
      collapse: !state.collapse
    }));
  }
  toggle1() {
    this.setState(state => ({
      collapse1: !state.collapse1
    }));
  }
  toggle2() {
    this.setState(state => ({
      collapse2: !state.collapse2
    }));
  }
  toggle3() {
    this.setState(state => ({
      collapse3: !state.collapse3
    }));
  }
  toggle4() {
    this.setState(state => ({
      collapse4: !state.collapse4
    }));
  }
  toggle5() {
    this.setState(state => ({
      collapse5: !state.collapse5
    }));
  }
  render() {
    return ( <
      VerticalScrollbars style = {
        {
          width: 350
        }
      }
