      div className = "org-selector" >
      <
      p className = "text-white text-left" > Selector < /p> <
      input type = "text"
      className = "search-input" / >
      <
      img src = {
        search
      }
      alt = "starlify"
      className = "search-icon" / >
      <
      /div> <
      div className = "systems w-100 d-inline-block" >

      <
      VerticalScrollbars style = {
        {
          height: 300
        }
      } >
