      p className = "text-white"
      onClick = {
        this.toggle
      }
      style = {
        {
          marginBottom: '1rem'
        }
      } > Systems < /p> <
      Collapse isOpen = {
        this.state.collapse
      } >
      <
      p className = "text-white"
      onClick = {
        this.toggle1
      }
      style = {
        {
          marginBottom: '1rem',
          marginLeft: '2rem'
        }
      } > Subsystems < /p> <
      Collapse isOpen = {
        this.state.collapse1
